import React, { Component } from "react";
import { Issuers } from "./const.js";

import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';


class FeeFilter extends Component {
  render() {
    let filter = this.props.filter;

    return (
      <FormControl>
        <InputLabel>Issuer</InputLabel>
        <Select value={filter["annualfee"]} onChange={this.props.changeFee}>
          <MenuItem value={Issuers.ALL_ISSUERS}>All</MenuItem>
          <MenuItem value={Issuers.AMEX}>American Express</MenuItem>
          <MenuItem value={Issuers.BARC}>Barclaycard</MenuItem>
          <MenuItem value={Issuers.BOA}>Bank of America</MenuItem>
          <MenuItem value={Issuers.CHASE}>Chase</MenuItem>
        </Select>
      </FormControl>
    )

  }
}

export default FeeFilter;
